import 'dart:math' show Random;

import 'package:get_it_example/apibase/api_response.dart';
import 'package:get_it_example/models/user_info.dart';
import 'package:get_it_example/values/enumeration.dart';

/// This class is just used to simulate the real-application's API calls
class ApiRepository {
  final Random _rd = Random();

  int get _delay => Random().nextInt(500);

  final List<String> _qrCodes = [
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
  ];

  Future<APIResponse<UserInfo?>> loginWithEmailPassword(
    String email,
    String password,
  ) async {
    await Future.delayed(Duration(milliseconds: _delay));
    var validCredentials =
        email == "testuser@gmail.com" && password == "123456";
    return APIResponse(
      data: validCredentials
          ? UserInfo(id: '023', name: 'Janak', type: UserType.buyer)
          : null,
      code: validCredentials ? 200 : 400,
    );
  }

  Future<APIResponse<String>> getLoginQR() async {
    await Future.delayed(Duration(milliseconds: _delay));
    return APIResponse(data: _qrCodes.elementAt(_rd.nextInt(_qrCodes.length)));
  }
}
